export const initialState = {
  mainPoasts: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: "NotAngry",
      },
      content: "첫 버드",
      Images: [
        { src: "http://placehold.it/500x500" },
        { src: "http://placehold.it/450x450" },
        { src: "http://placehold.it/400x400" },
      ],
    },
  ],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
